import React from 'react';

const Home = () => {
  return (
    <div className="min-h-screen bg-[#1c2541] py-10">
      <div className="container mx-auto flex flex-col gap-4">
        <div>
          <h1 className="text-4xl font-medium text-center text-gray-100">React Movies</h1>
        </div>
        <div className="flex justify-center w-">
          <form>
            <div class="max-w-xl">
              <div class="flex space-x-4">
                <div class="flex rounded-md overflow-hidden w-full">
                  <input type="text" class="w-full rounded-md rounded-r-none" />
                  <button class="bg-indigo-600 text-white px-6 text-lg font-semibold py-4 rounded-r-md">Go</button>
                </div>
              </div>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Home;
